CREATE TABLE Pol(
	PolID int PRIMARY KEY NOT NULL,
	Pol nvarchar(10) NOT NULL
	)
	CREATE TABLE Svojstvo_Roditelja(
	SvojstvoID int PRIMARY KEY NOT NULL,
	Svojstvo nvarchar(10) NOT NULL
	)
	CREATE TABLE Roditelj(
	RoditeljID int PRIMARY KEY NOT NULL,
	SvojstvoID int NOT NULL REFERENCES Svojstvo_Roditelja(SvojstvoID),
	Ime nvarchar(50) NOT NULL,
	Prezime nvarchar(50) NOT NULL,
	Adresa nvarchar(50) NULL,
	FiksniTelefon varchar(20) NULL,
	MobilniTelefon varchar(20) NULL,
	)
	CREATE TABLE Dete(
	DeteID int PRIMARY KEY NOT NULL,
	PolID int NOT NULL REFERENCES Pol(PolID),
	Ime nvarchar (50) NOT NULL,
	Prezime nvarchar(50) NOT NULL,
	DatumRodjenja datetime NULL,
	Beleske nvarchar(500) NULL,
	RoditeljID int NOT NULL REFERENCES Roditelj(RoditeljID)
	)
	CREATE TABLE Aktivnosti(
	AktivnostID int PRIMARY KEY NOT NULL,
	NazivAktivnosti nvarchar(50) NOT NULL,
	Pocetak datetime NULL,
	Zavrsetak datetime NULL,
	Dan nchar(15) NULL
	)
	CREATE TABLE Registar_Aktivnosti(
	AktivnostID int NOT NULL REFERENCES Aktivnosti(AktivnostID),
	DeteID int NOT NULL References Dete(DeteID),
	Datum datetime NOT NULL PRIMARY KEY,
	Prisustvo bit NULL DEFAULT ((1)),
	Belseka nvarchar(500) NULL
	)
